import React, { useState } from "react";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Label } from "@/components/ui/label";
import { Card, CardHeader, CardTitle, CardContent, CardFooter } from "@/components/ui/card";
import {
  Dialog,
  DialogContent,
  DialogDescription,
  DialogHeader,
  DialogTitle,
} from "@/components/ui/dialog";

const Registro = () => {
  const [formData, setFormData] = useState({
    pnombre: "",
    ubicacion: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    snombre: "",
    papellido: "",
    sapellido: "",
    usuario: {
      login: "",
      password: "",
    },
  });

  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState("");
  const [modalType, setModalType] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("usuario.")) {
      const usuarioField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        usuario: { ...prevData.usuario, [usuarioField]: value },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const currentDate = new Date();
    const selectedDate = new Date(formData.fechaNacimiento);
    const year = selectedDate.getFullYear();

    if (selectedDate > currentDate) {
      alert("La fecha de nacimiento no puede ser futura.");
      return;
    }

    if (year < 1900 || year > 2100) {
      alert("El año de nacimiento debe estar entre 1900 y 2100.");
      return;
    }

    const dataToSend = {
      pnombre: formData.pnombre,
      ubicacion: formData.ubicacion,
      identificacion: parseInt(formData.identificacion),
      email: formData.email,
      fechaNacimiento: formData.fechaNacimiento,
      snombre: formData.snombre,
      papellido: formData.papellido,
      sapellido: formData.sapellido,
      usuario: {
        login: formData.usuario.login,
        password: formData.usuario.password,
      },
    };

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(dataToSend),
      });

      let responseData;
      const contentType = response.headers.get("content-type");
      if (contentType && contentType.includes("application/json")) {
        responseData = await response.json();
      } else {
        responseData = await response.text();
      }

      if (response.ok) {
        setModalMessage(typeof responseData === 'object' ? responseData.message : responseData);
        setModalType("success");
      } else {
        setModalMessage(typeof responseData === 'object' ? responseData.message : responseData);
        setModalType("error");
      }
      setShowModal(true);
    } catch (error) {
      console.error("Error:", error);
      setModalMessage("Error en la solicitud.");
      setModalType("error");
      setShowModal(true);
    }
  };

  const handleCloseModal = () => {
    setShowModal(false);
    setFormData({
      pnombre: "",
      ubicacion: "",
      identificacion: "",
      email: "",
      fechaNacimiento: "",
      snombre: "",
      papellido: "",
      sapellido: "",
      usuario: {
        login: "",
        password: "",
      },
    });
  };

  return (
    <div className="container mx-auto mt-10 p-6">
      <Card className="w-full max-w-2xl mx-auto">
        <CardHeader>
          <CardTitle>Agregar Persona</CardTitle>
        </CardHeader>
        <CardContent>
          <form onSubmit={handleSubmit} className="space-y-4">
            <div className="grid grid-cols-2 gap-4">
              <div className="space-y-2">
                <Label htmlFor="pnombre">Primer Nombre:</Label>
                <Input
                  id="pnombre"
                  name="pnombre"
                  value={formData.pnombre}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="space-y-2">
                <Label htmlFor="snombre">Segundo Nombre:</Label>
                <Input
                  id="snombre"
                  name="snombre"
                  value={formData.snombre}
                  onChange={handleChange}
                />
              </div>
              <div className="space-y-2">
                <Label htmlFor="papellido">Primer Apellido:</Label>
                <Input
                  id="papellido"
                  name="papellido"
                  value={formData.papellido}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="space-y-2">
                <Label htmlFor="sapellido">Segundo Apellido:</Label>
                <Input
                  id="sapellido"
                  name="sapellido"
                  value={formData.sapellido}
                  onChange={handleChange}
                />
              </div>
              <div className="space-y-2">
                <Label htmlFor="ubicacion">Ubicación:</Label>
                <Input
                  id="ubicacion"
                  name="ubicacion"
                  value={formData.ubicacion}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="space-y-2">
                <Label htmlFor="identificacion">Identificación:</Label>
                <Input
                  id="identificacion"
                  name="identificacion"
                  type="number"
                  value={formData.identificacion}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="space-y-2">
                <Label htmlFor="email">Email:</Label>
                <Input
                  id="email"
                  name="email"
                  type="email"
                  value={formData.email}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="space-y-2">
                <Label htmlFor="fechaNacimiento">Fecha de Nacimiento:</Label>
                <Input
                  id="fechaNacimiento"
                  name="fechaNacimiento"
                  type="date"
                  value={formData.fechaNacimiento}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>
            <div className="space-y-2">
              <h3 className="text-lg font-semibold">Usuario</h3>
              <div className="grid grid-cols-2 gap-4">
                <div className="space-y-2">
                  <Label htmlFor="usuario.login">Login:</Label>
                  <Input
                    id="usuario.login"
                    name="usuario.login"
                    value={formData.usuario.login}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="space-y-2">
                  <Label htmlFor="usuario.password">Contraseña:</Label>
                  <Input
                    id="usuario.password"
                    name="usuario.password"
                    type="password"
                    value={formData.usuario.password}
                    onChange={handleChange}
                    required
                  />
                </div>
              </div>
            </div>
          </form>
        </CardContent>
        <CardFooter className="flex justify-between">
          <Button type="submit" onClick={handleSubmit}>Guardar</Button>
          <Button variant="outline" onClick={() => window.location.href = "/login"}>
            Regresar a Login
          </Button>
        </CardFooter>
      </Card>

      <Dialog open={showModal} onOpenChange={setShowModal}>
        <DialogContent>
          <DialogHeader>
            <DialogTitle>{modalType === "success" ? "Éxito" : "Error"}</DialogTitle>
            <DialogDescription>{modalMessage}</DialogDescription>
          </DialogHeader>
          <Button onClick={handleCloseModal}>Cerrar</Button>
        </DialogContent>
      </Dialog>
    </div>
  );
};

export default Registro;
